import styled from "styled-components";
import { desktop } from "../../constants/breakpoints";

export const SectionContainer = styled.section`
  height: 100vh;
  overflow: scroll;

  & > h1 {
      color: white;
  }
`;

export const SectionContent = styled.div`
  padding: 0 2rem;
  height: 100%;

  ${desktop} {
    padding: 0 8rem;
  }
`;
